import React from 'react'
import './Hello.css'

class Hello extends React.Component{
    state={isok:true}
    Hello_learn_React =()=>{
        console.log("已经开始学习react")
        const isok=this.state.isok
        this.setState({isok:!isok})
    }

    render() {
        const {isok}=this.state
        return (
            <div>
                <h2 className="Hello_title" onClick={this.Hello_learn_React}>学习react已经{isok ? 'ok':'no'}</h2>
                <button>点击我们就开始</button>
            </div>
        );
    }
}
export default Hello
